const SellerOrders = ({ userid }) => {

    const [orders, setOrders] = useState(null);

    const getAllOrders = () => {
        axios({
            method: "GET",
            url: "http://localhost:5000/order/getorders/"+userid,
            
          }).then(res => {
              console.log(res.data);
              setOrders(res.data);
          });
    }

    useEffect(() => {
        getAllOrders();
        }, [])

    return(
        <div>
            <h1>Seller Orders Page</h1>
        </div> 
    )
}

export default SellerOrders;
